import React from "react";
import Typewriter from "typewriter-effect";
import "./home.css";
function home() {
  return (
    <div class="container1">
      <h1>Hello Everyone I am Anish Kumar Singh</h1>
      <p id="into">
        I am a Second Year CSE Undergrad at BIT MESRA.I like to explore all
        domains and learn new stuffs. My Hobbies Include Playing Table Tennis
        and Volleyball
      </p>
      <Typewriter
        class="typer"
        onInit={(typewriter) => {
          typewriter
            .typeString("I am Anish Kumar Singh")
            .pauseFor(2500)
            .deleteAll()
            .typeString("Programmer")
            .pauseFor(2500)
            .deleteAll()
            .typeString("Developer")
            .pauseFor(2500)
            .deleteAll()
            .start();
        }}
      />
    </div>
  );
}

export default home;
